MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Administration tasks include installing and configuring the Calibre software, installing and configuring licensing, and configuring Calibre jobs to run in a distributed environment.");
MGCAddSnippet(6, "The audience for this manual includes individuals that are familiar with the systems and network at their site, and with the Calibre tools. Administrative tasks for Calibre include configuring the network and hardware, installing the Calibre software, installing and configuring the licensing environment, and configuring Calibre jobs to run in a distributed environment.");
MGCAddSnippet(7, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(8, "Calibre runs on different hardware architectures and operating systems and, depending on your environment, may require you to perform some specific configuration tasks.");
MGCAddSnippet(9, "The Calibre tools run on various combinations of operating systems and hardware architectures. ");
MGCAddSnippet(10, "The Calibre software is packaged into three CALIBRE_HOME executables: AOI, AOJ and AOK.");
MGCAddSnippet(11, "For each OS version, the Calibre tools require a minimum OS patch level. Siemens EDA tests Calibre tools with the vendor-recommended OS patch sets. However, given the number of OS patches and the frequency of updates, Siemens EDA cannot test the Calibre tools with all possible versions and variations of a vendor s OS patches. If you deviate from the OS patch sets recommended by Siemens EDA, there is no guarantee the Calibre tools will function correctly. Nevertheless, most OS vendors ensure, when possible, forward compatibility of patch versions.");
MGCAddSnippet(12, "The different executables for the AOI, AOJ, and AOK trees are optimized for different operating system and hardware environments. A mixed operating system environment is not supported when using these trees.");
MGCAddSnippet(13, "The Calibre tools are qualified and supported on x86-64 processors supplied by different vendors.");
MGCAddSnippet(14, "If you encounter problems using Siemens EDA tools on an unsupported Linux distribution, and the problem can be duplicated on a supported production Linux distribution, it will be addressed through normal Siemens EDA support policies. If a problem only exists on the unsupported Linux distribution, the fix lies in a change to the Linux environment, not the Siemens EDA product. In this case, you should contact your Linux supplier.");
MGCAddSnippet(15, "Configuration tasks may include configuring virtual machines in order to run older versions of Calibre on newer hardware, monitoring multithreaded Calibre runs, and configuring the log file output.");
MGCAddSnippet(16, "Differences may be observed in the results from OPC jobs that are run on an AOI and an AOJ Calibre tree. The differences in results are because of the different hardware processors and operating system libraries that are supported by the different Calibre trees.");
MGCAddSnippet(17, "If you experience a performance degradation when running Calibre on an RHEL 7 operating system, there is a utility and profile available with RHEL 7 that you can use to improve performance.");
MGCAddSnippet(18, "To support Python and TensorFlow usage, some RPM packages, which contain libraries needed for Python and TensorFlow, must be added to some of the standard SLES environments. You should also ensure your environment is properly configured for running the Calibre version of Python.");
MGCAddSnippet(19, "The xorg-x11-fonts-misc-* package is required in order for Calibre_Xvfb (virtual framebuffer X) to work. Releases prior to RHEL 7 loaded the xorg‑x11‑fonts‑misc‑* package by default. For Calibre_Xvfb to work on RHEL 7 systems, you must load the xorg‑x11‑fonts‑misc‑* package from the RHEL 7 distribution.");
MGCAddSnippet(20, "Some customers (for example, foundries) are required to run older versions of Calibre to support production lines. Many of these same customers also want to upgrade to newer hardware to take advantage of performance improvements and power savings. However, newer x86-64 servers have processors that require more recent versions of Linux.");
MGCAddSnippet(21, "There is a futex issue with the fourth generation Intel CPU. If you have this CPU, there are RHEL kernel versions available that include a fix.");
MGCAddSnippet(22, "Each OS has limits on the number of files you can simultaneously have open. During normal operation, some Calibre tools can exceed this limit and produce undesirable results. Check your OS vendor s documentation if you experience issues with exceeding this OS limit. ");
MGCAddSnippet(23, "For Calibre 2011.2 and later releases, Calibre tools will not invoke on Linux platforms with a sticky bit Calibre executable setting. ");
MGCAddSnippet(24, "In some cases, a Linux kernel setting for the SLES 12 operating system generates the message  PTHREAD CREATE FAILURE  in the transcript for a Calibre run.");
MGCAddSnippet(25, "The  cpuspeed  option for RHEL operating systems and the  CPUFREQ_ENABLED  option for SLES operating systems provide a variable speed capability that enables CPUs to throttle down below their full speed when they are not being utilized. You should disable these options to avoid the performance impact due to the ramp up of the CPUs when they are engaged. For RHEL operating systems,  cpuspeed  is the name of the process. For SLES-based operating systems, the CPUFREQ_ENABLED option is disabled in the powersave configuration file.");
MGCAddSnippet(26, "When performing multithreaded Calibre runs on Linux platforms, you can monitor the thread status using either the ps or top command. The top command can give you misleading results on thread or process memory usage because it shows each thread the OS spawns from the primary thread; however, the memory size is identical to the primary thread. ");
MGCAddSnippet(27, "You can use the CALIBRE_PRINT_TIME_STAMPS environment variable to configure Calibre to output an absolute time stamp to the log file. Set this variable to any value (including nil) to have Calibre output the date and time after the ELAPSED TIME. ");
MGCAddSnippet(28, "Some Calibre tools use third-party software to implement some of the interfaces in Calibre and provide customization capabilities. Occasionally, there are updates to third-party software packages that you should be aware of.");
MGCAddSnippet(29, "Calibre uses Tcl 8.6 starting with the 2019.2 release. Tcl is used to implement a number of interfaces in Calibre and several Calibre products use Tcl scripts to control execution and tool flow.");
MGCAddSnippet(30, "Depending upon the Calibre release you plan to install, slightly different steps may be required. Refer to the appropriate installation instructions and supplementary information for the Calibre version you plan to install.");
MGCAddSnippet(31, "Effective with the 2013.4 and newer releases, the CALIBRE_HOME tree is packaged into the following trees: IXL (discontinued with 2021.1), AOI, AOJ and AOK. The different executables, which include both the software and documentation, are optimized for the different Linux distributions. The AOJ download requires AVX2-capable hardware in order to execute. If your network includes a mix of different Linux distributions, you can install and run the different CALIBRE_HOME trees.");
MGCAddSnippet(32, "For the 2013.1 through 2013.3 Calibre releases, the software and documentation are combined into one Mentor Graphics Install Bundle, with an _mib.exe suffix. When installing on a Linux box, the combined software and documentation installation file is run as a self-extracting executable.");
MGCAddSnippet(33, "Effective with the 2012.2 release, both the software and the documentation installation files are packaged in separate Siemens EDA Install Bundles, with an  _mib.exe  suffix. The installation process is different for Linux and non-Linux platforms.");
MGCAddSnippet(34, "When installing the 2012.2 through 2012.4 Calibre software and documentation on a Linux platform, both the software and the documentation installation files are run as self-extracting executables.");
MGCAddSnippet(35, "When installing the 2012.2 through 2012.4 Calibre software and documentation on a non-Linux platform, you must use the Siemens EDA Install GUI to install the documentation.");
MGCAddSnippet(36, "The software and documentation for the Calibre 2009.3 through 2012.1 releases are packaged separately, and there are separate methods for installing each package. You can install Calibre 2009.3 through Calibre 2012.1 software releases on UNIX platforms using the Siemens EDA Install utility and Siemens EDA Install Bundles (MIB).");
MGCAddSnippet(37, "The software and documentation for the Calibre 2008.1 through 2009.2 releases are packaged separately, and there are separate methods for installing each package. The product documentation is available on Support Center as a separate downloadable Siemens EDA Install (.mis) file and also on the Calibre Documentation CD. You can install both software and documentation for Calibre 2008.1 through Calibre 2009.2 on UNIX platforms using the Siemens EDA Install utility and Siemens EDA Install Bundles (MIB).");
MGCAddSnippet(38, "You can install Calibre 2007.2 through Calibre 2007.4 software releases on UNIX platforms using the Siemens EDA Install utility and Siemens EDA Install Bundles (MIB). ");
MGCAddSnippet(39, "The Siemens EDA Install program returns errors if the installation process does not complete, or if the installation process completed but detected certain problems within the installation.");
MGCAddSnippet(40, "There are some common tasks an administrator performs after installing and before running the Calibre software.");
MGCAddSnippet(41, "The CALIBRE_HOME environment variable defines the location of the Calibre software tree. ");
MGCAddSnippet(42, "Before invoking a Calibre tool, you must set the CALIBRE_HOME environment variable to point to the location of your Calibre software tree. ");
MGCAddSnippet(43, "Use the calibre_vco utility, located in the Calibre software tree, to determine the VCO of your current platform.");
MGCAddSnippet(44, "The Calibre software tree contains a series of system tests you can execute to verify the installation of the Calibre software.");
MGCAddSnippet(45, "The Calibre documentation includes user, reference, quick reference cards, and process documentation in both HTML and PDF formats to offer you the various features and benefits of each format. The actual content does not vary between the formats. You can also configure the environment to install and access the documentation from another location, other than the default install location. ");
MGCAddSnippet(46, "The Calibre documentation resides in a self-contained directory structure. All links between documents are relative to each other. This enables you to make a copy of this directory and store it in any location and still have it function as a complete tree.");
MGCAddSnippet(47, "Calibre tools support moving the documentation to an alternate location and also setting a default PDF viewer.");
MGCAddSnippet(48, "Calibre provides multiple licensing models, configuration file options, and command line options allowing you to customize licensing to meet the needs of your environment.");
MGCAddSnippet(49, "Calibre tools require the correct versions of both MSL and FLEXnet to manage the administration of licenses.");
MGCAddSnippet(50, "The Calibre tools use the Mentor Standard Licensing (MSL) for administering software licenses. MSL is based on FLEXnet licensing software and uses the FLEXnet license file format. MSL enables easy integration of Mentor Graphics licenses into most licensing strategies.");
MGCAddSnippet(51, "MSL uses license records stored in an ASCII license file and maintained by the system administrator. This license file can be located anywhere in the file system. The system administrator can provide you with the license file pathname. You must provide the pathname when setting the licensing environment variables.");
MGCAddSnippet(52, "In general, Calibre tools secure any required licenses immediately after invocation and release these licenses after the run completes. However, there are some tools, such as Calibre Connectivity Interface (CCI), where licenses are secured in mid-execution of a session or script.");
MGCAddSnippet(53, "If the connection between a Calibre tool and the MSL license server is lost, then Calibre re-establishes connections.");
MGCAddSnippet(54, "There are two models, Calibre Classic Licensing and Calibre Loop Licensing, that determine how busy licenses are handled by Calibre tools. Calibre Classic Licensing is the default licensing model and supports the ability to queue for and to substitute licenses. Calibre Loop Licensing does not queue for licenses, but rather initiates a looping behavior in an attempt to secure the required (default) or substitute licenses.");
MGCAddSnippet(55, "Calibre Classic Licensing is the default licensing model and supports the ability to queue for and to substitute licenses. While all Calibre tools use license queueing, only selected Calibre tools use license substitution.");
MGCAddSnippet(56, "Calibre Loop Licensing is an alternative method to Calibre Classic Licensing. With Calibre Loop Licensing, if Calibre is unable to acquire licenses, it continues looping to acquire the necessary licenses for running the Calibre tool. FLEXnet license queueing is never used in this mode. Looping automatically exits when Calibre is unable to acquire licenses because the license server is down or there are problems related to acquiring licenses. Even though this is not the default licensing model, this is the recommended model for new installations.");
MGCAddSnippet(57, "The licensing configuration file is an ASCII file you create to specify the licensing model that is used by Calibre tools.");
MGCAddSnippet(58, "You control licensing behavior by specifying statements in a licensing configuration file and configuring the access to this file.");
MGCAddSnippet(59, "Specifies the Calibre Classic licensing mode and available configuration options.");
MGCAddSnippet(60, "Specifies the Calibre Loop licensing mode and available configuration options.");
MGCAddSnippet(61, "Calibre licensing command line options are used to control licensing behavior. These options are not supported for all command line invocations (for example, Calibre® xACT™ digital flow does not support the -wait and -nowait command line options). Use the calibre -help command to determine which Calibre tools support these licensing options.");
MGCAddSnippet(62, "Calibre Classic Licensing and Calibre Loop Licensing both produce log information that you can configure using the CALIBRE_LM_LOG_LEVEL environment variable. This information is written to the Calibre transcript.");
MGCAddSnippet(63, "A license consumption formula is used by applicable Calibre tools to determine the number of licenses needed for a multithreaded Calibre job.");
MGCAddSnippet(64, "When using Simultaneous Multithreading (SMT) functionality to run a Calibre job using virtual cores, only the physical CPUs are counted toward license requirements. After all physical CPUs are licensed, Calibre automatically launches additional threads for execution on the virtual cores. Calibre does not require additional licenses for the additional threads on the virtual cores. ");
MGCAddSnippet(65, "The license reference pages use a standard format for providing license information for Calibre products. ");
MGCAddSnippet(66, "With Calibre classic licensing, options are available for controlling license queuing and license substitution. With Calibre loop licensing, an alternate method to Calibre classic licensing, you can control the acquisition of licenses. ");
MGCAddSnippet(67, "Depending on your environment, you will need to set either the LM_LICENSE_FILE or the MGLS_LICENSE_FILE environment variable to point to a valid license file or license daemon before invoking a Calibre tool.");
MGCAddSnippet(68, "You can control license queueing for Calibre tools using the ‑wait and -nowait switches during the invocation of a Calibre tool. These switches are mutually exclusive.");
MGCAddSnippet(69, "You can disable license queueing for Calibre tools using the ‑nowait switch during the invocation of a Calibre tool. ");
MGCAddSnippet(70, "During license substitution, selected Calibre tools check the license file for available required licenses. If you have not defined the required license but have defined a substitute license, then the Calibre tool acquires or queues for the substitute license or licenses.");
MGCAddSnippet(71, "In this procedure you use the RETRY MODE LOOP statement to configure your licensing environment for Calibre loop licensing.");
MGCAddSnippet(72, "The licensing information for Calibre platform and general products provides information on required and substitute licenses, in addition to any considerations and exceptions.");
