MGCAddSnippet(184, "The multithreaded, distributed processing capability of Calibre provides a high performance data architecture that utilizes CPUs on  and remote hosts for faster processing of full chip and other large designs. With this data architecture, you can take advantage of large SMP servers and low-cost network processors, such as rack-mount systems.");
MGCAddSnippet(185, "There are some recommended steps to help you get started using the Calibre distributed processing capabilities. In addition, understanding some basic concepts about scaling, scalability, and SMT‑enabled hardware will help you get the best results in a distributed Calibre run.");
MGCAddSnippet(186, "There are several different multithreaded processing modes available for distributing your design data or Calibre processes across multiple CPUs in order to speed up the processing of a Calibre job. ");
MGCAddSnippet(187, "MT refers to multithreaded CPU technology that runs more than one thread of execution within an operating system. This technology speeds up the processing of a Calibre job by leveraging the multiple CPUs available on one host.");
MGCAddSnippet(188, "Calibre MTflex functionality provides a parallel processing data architecture for running multithreaded Calibre tools on distributed networked computers. When you run a tool with Calibre MTflex functionality, Calibre creates threads and processes as needed across the network to remote computers.");
MGCAddSnippet(189, "Multithreading (MT) and Calibre MTflex provide a high performance data architecture for faster processing of full chip and other large designs, while hyperscaling provides an architecture for distributing SVRF operations. Hyperscaling can be used with both MT and Calibre MTflex runs, providing designers significant performance improvements while taking simultaneous advantage of large SMP (Shared-memory Processor) servers and low-cost network processors, such as rack-mount systems.");
MGCAddSnippet(190, "Simultaneous multithreading (SMT) improves CPU efficiency by treating each physical CPU as two logical CPUs (one physical and one virtual). The processor causes the operating system to behave as if there are twice as many CPUs, so the operating system schedules twice as many processes to run.");
MGCAddSnippet(191, "Remote Data Server (RDS) technology is designed to reduce primary host memory requirements and improve Calibre MTflex performance by distributing data across remote hosts. It is supported for 64-bit Calibre and remote host processes. Because of the distributed nature of the data, every remote host used in a Calibre MTflex run must be able to communicate with every other remote host in the run.");
MGCAddSnippet(192, "The hyper remote functionality enables Pseudo Hierarchical Databases (HDBs) to be distributed across remote hosts, thereby reducing memory requirements on the primary host and improving Calibre MTflex performance.");
MGCAddSnippet(193, "Calibre FullScale is a multi-processing platform designed to improve scalability and runtime for typical post-tapeout runs. Calibre FullScale supports a limited set of SVRF operations, setlayer commands, and models.");
MGCAddSnippet(194, "Calibre provides data processing modes that optimize the input hierarchy by partitioning data into a uniform and hierarchical structure of bins. These modes are primarily used for jobs that have little or no incoming hierarchy (for example, post-Litho operations) and Calibre jobs that cause significant hierarchical degradation during a run (for example, Litho or fill operations). These cases generally contain pre- or post-Litho SVRF operations.");
MGCAddSnippet(195, "Calibre TURBOflex is a data processing option that can achieve highly scalable parallel processing on large, multi-CPU servers and distributed compute systems (clusters). TURBOflex is most useful in a post-tapeout flow that significantly modifies the database hierarchy during processing, and should be used with extreme caution in traditional DRC flows on highly hierarchical databases. ");
MGCAddSnippet(196, "Calibre ULTRAflex is a data processing option that can achieve highly scalable parallel processing on large, multi-CPU servers and distributed compute systems (clusters). ULTRAflex is most useful in a post-tapeout flow and should be used with extreme caution in traditional DRC flows on highly hierarchical databases. The overall runtime for ULTRAflex is typically slower than TURBOflex.");
MGCAddSnippet(197, "There are some hardware, network, licensing, and shared memory configuration requirements and guidelines for using distributed Calibre.");
MGCAddSnippet(198, "There are some minimum recommended hardware configuration guidelines for the primary and remote hosts you use for Calibre jobs. In general, when running Calibre MTflex on clusters of more than 400 remote CPUs, consult with your IT department to ensure that adequate system resources are available for your target operating system.");
MGCAddSnippet(199, "The network configuration is an important consideration for a distributed Calibre environment. While the data being transmitted is small, the frequency of transmission between the  and remote hosts is high. As a result, a dedicated, high-speed network between the  and remote hosts is recommended.");
MGCAddSnippet(200, "The recommended Calibre MTflex network setup, testing, and performance validation is intended to support all Calibre applications that run in an MTflex environment, including DRC, OPC, and MDP tools. Refer to the applicable user s manual for product-specific details about using the tool in a distributed environment.");
MGCAddSnippet(201, "You can use scripts (similar to  cluster health  scripts) to minimize Calibre MTflex issues. Use of  cluster health  scripts enables the use of the MINCOUNT argument in the LAUNCH AUTOMATIC, LAUNCH CLUSTER, and LAUNCH MANUAL statements, which prevents unexpectedly long Calibre run times due to insufficient allocation of remote hosts. Unsupported pseudo-code is available on request. These scripts run in conjunction with a reliable job scheduler or Distributed Resource Management System (DRMS).");
MGCAddSnippet(202, "Network hardware monitoring greatly reduces Calibre MTflex troubleshooting time and, in some cases, can prevent long running jobs from failing by allowing problems to be corrected in a production environment before they become fatal.");
MGCAddSnippet(203, "There are some network routing best practices and routing commands for determining the routing setup.");
MGCAddSnippet(204, "Generally, Calibre MTflex works well with default Linux kernel and driver settings. A few changes may be necessary for large Calibre MTflex clusters that include many hundreds of remote CPUs.");
MGCAddSnippet(205, "There are no requirements for unique licenses in order to run Calibre in a distributed environment. When you invoke a Calibre tool to run in a distributed environment, Calibre queries the operating system to determine the number of CPUs and recognizes multiple cores or hardware threads as individual CPUs.");
MGCAddSnippet(206, "When Calibre runs an operation, it needs some memory for computation and some memory to hold data. When hyperscaling is used, sometimes an operation on one HDB uses the same memory as an operation on a separate HDB. To reduce the overall memory footprint in such cases, data is transferred from the first HDB to the second HDB, and the amount of data transferred is written to the SHARED component. The SHARED statistic output to the transcript is the amount of memory in megabytes that was transferred between HDBs for a particular operation. For example:");
MGCAddSnippet(207, "You can use distributed resource management tools, such as IBM Spectrum LSF (formerly IBM Platform LSF) or Univa Grid Engine, to manage workload processing for compute- and data-intensive applications. These tools are useful for scheduling and tracking the completion of Calibre jobs in a distributed environment.");
MGCAddSnippet(208, "Calibre does not support the job checkpointing capabilities in IBM Spectrum LSF and Univa Grid Engine.");
MGCAddSnippet(209, "Calibre supports suspending and resuming jobs, typically employed using the bstop and bresume commands for IBM Spectrum LSF and the qmod command for Univa Grid Engine. When a job is suspended, it remains in memory but Calibre releases all licenses and suspends operation. When the job is resumed, Calibre checks out the license(s) and continues the run.");
MGCAddSnippet(210, "Some commonly used IBM Spectrum LSF commands include bsub, bjobs, and bqueues. For more information on these and other IBM Spectrum LSF commands, refer to your IBM Spectrum LSF documentation.");
MGCAddSnippet(211, "Some commonly used Univa Grid Engine commands include qhost, qstat, and qsub. For more information on these and other Univa Grid Engine commands, refer to your Univa Grid Engine documentation.");
MGCAddSnippet(212, "There are some known issues related to using distributed Calibre.");
MGCAddSnippet(213, "Due to the inherent differences in floating-point calculations, different hardware platforms show differences in Calibre output. These differences are typically limited to one database unit or one step size for any given Calibre operation. These differences are considered within an acceptable accuracy tolerance for Calibre.");
MGCAddSnippet(214, "When performing multithreaded or Calibre MTflex runs, you can encounter situations where you run out of available licenses for the Calibre software run. Running out of licenses causes the Calibre application either to exit with a warning or to run with fewer licenses.");
MGCAddSnippet(215, "In some cases, when running Calibre MTflex where a large number of remotes are concurrently writing back to a primary host, an error message is generated.");
MGCAddSnippet(216, "Running a job in Calibre MTflex and Hyperscaling modes (‑turbo ‑hyper) may occasionally generate a  PTHREAD INIT Failure  or  Hyper data storage failure  error message.");
MGCAddSnippet(217, "Some Calibre tools take advantage of the multithreaded (MT) or Calibre MTflex capability and, when possible, also leverage hyperscaling capabilities.");
MGCAddSnippet(218, "Some Calibre Physical Verification products support multithreaded (MT) or Calibre MTflex with or without hyperscaling.");
MGCAddSnippet(219, "Some Calibre Design for Manufacturability (DFM) products support multithreaded (MT) or Calibre MTflex with or without hyperscaling.");
MGCAddSnippet(220, "Some Calibre Parasitic Extraction (PEX) products support multithreaded (MT) or Calibre MTflex with or without hyperscaling.");
MGCAddSnippet(221, "Some Calibre Resolution Enhancement Technology (RET) products support multithreaded (MT) or Calibre MTflex with or without hyperscaling.");
MGCAddSnippet(222, "Some Calibre Mask Data Preparation (MDP) products support multithreaded (MT) or Calibre MTflex with or without hyperscaling.");
MGCAddSnippet(223, "Any SVRF operation may appear in a rule file used for distributed Calibre runs. While not all SVRF operations are distributed, the operations that can scale will do so automatically. Those operations that do not participate in distributed processing run only on the primary host. Some Calibre tools may have limitations or restrictions for running in distributed Calibre mode.");
MGCAddSnippet(224, "Distributed Calibre functionality is available with CalibrexRC when creating the Parasitic Database (PDB).");
MGCAddSnippet(225, "By default, only the CPU usage for the primary host is provided in the transcript when running Calibre OPCpro in Calibre MTflex mode. Full CPU time statistics for both the local and remote hosts are available after the OPCpro run has completed and the total runtime information for each command group is printed to the log file.");
MGCAddSnippet(226, "The Calibre FRACTURE tools include: FRACTUREc, FRACTUREh, FRACTUREi, FRACTUREj, FRACTUREm, FRACTUREn, FRACTUREp, FRACTUREt, and FRACTUREv. These tools, when run with distributed Calibre, create temporary files on remote hosts during FRACTURE operations. You can use the LOCAL HOST DIR statement to specify a directory on the primary host where these tools can write temporary files.");
MGCAddSnippet(227, "During Calibre MTflex processing, remote processes directly access the chip files referenced in the input and output rule files. To ensure these files are visible to remote hosts, Calibre MDPmerge places restrictions on the input and output parsing of directory data.");
MGCAddSnippet(228, "You can use hyperscaling with Calibre MDP applications. There is currently a limitation that prohibits the use of commands that depend on each other. External file input cannot be verified during the run and hence a Calibre MDPverify application relying on the output of the Calibre FRACTURE operations in the same run may fail due to a missing input file or an incomplete file.");
MGCAddSnippet(229, "You control Calibre MTflex functionality through the use of a configuration file.");
MGCAddSnippet(230, "A configuration file is an ASCII file that specifies information used for launching remote hosts to run a job in Calibre MTflex mode. The term launch refers to invoking Calibre on a remote host as a Calibre MTflex server and connecting to that server. The normal mode of operation is to launch a Calibre MTflex server automatically, but you can also manually invoke the server on a remote host and connect to the primary host.");
MGCAddSnippet(231, "You can change the default location of the MGC_HOME tree for each remote host from the configuration file. Specifying the location of the MGC_HOME tree is required if the remote hosts use a different platform from the primary host.");
MGCAddSnippet(232, "The configuration file for xCalibrate uses the same syntax conventions and configuration file statements as used with other Calibre tools, with the exception of the REMOTE COMMAND statement.");
MGCAddSnippet(233, "There are certain statements you can specify in your configuration file to control distributed Calibre operations.");
MGCAddSnippet(234, "You can define an environment variable in your operating system environment and subsequently use that variable in your Calibre MTflex configuration file.");
MGCAddSnippet(235, "Some of the more common scenarios for running a distributed Calibre job involve using the multithreaded (MT) or Calibre MTflex capabilities, with or without hyperscaling mode. Monitoring utilities allow you to track how the job is distributed along with the performance of the local and remote hosts.");
MGCAddSnippet(236, "Multithreaded (MT) mode enables multithreaded parallel processing functionality, which distributes a design across multiple CPUs on the same primary host. This procedure describes how to run a Calibre job in MT mode using the -turbo and ‑turbo_litho command line argument. ");
MGCAddSnippet(237, "To run a design in Calibre MTflex mode, you must specify the -remote or -remotefile argument during Calibre tool invocation. In this procedure, you create a configuration file that specifies the primary host, remote hosts, and launch method for running a job in Calibre MTflex mode. You then invoke Calibre, using the ‑remotefile argument to specify the path to the configuration file.");
MGCAddSnippet(238, "A heterogeneous environment is a network of local and remote hosts that include different processors.");
MGCAddSnippet(239, "You can create a configuration file in which you define the LAUNCH CLUSTER and REMOTE COMMAND statements. The LAUNCH CLUSTER statement sets parameters for the connection of the primary host to the remote hosts, while the REMOTE COMMAND statement starts a Calibre MTflex server on a remote host. You then execute Calibre using the ‑remotefile argument to specify the path to a configuration file. ");
MGCAddSnippet(240, "You can create a configuration file that includes a LAUNCH MANUAL statement. You then execute the Calibre job and use the calibre -mtflex command to manually connect each remote host to the primary host.");
MGCAddSnippet(241, "Hyperscaling is a mode of running Calibre in either Multithreaded (MT) or Multithreaded Distributed (Calibre MTflex) environments. Hyperscaling mode enables the parallel execution of SVRF operations, allowing operations to execute concurrently thereby increasing the utilization of CPUs and improving scalability. Hyperscaling is not used for single-threaded environments.");
MGCAddSnippet(242, "The monitoring utilities allow you to monitor the load and memory usage on individual machines in a cluster, as well as the input and output characteristics between the primary and remote hosts. The following steps describe how to use these capabilities, in addition to providing some debugging methodologies while using Calibre in a cluster environment.");
MGCAddSnippet(243, "The MONITOR SYSTEM command when used with the RRDGRAPH argument reports system level information using RRD graph functions. The MONITOR SYSTEM command generates a script named CalibreRRDGraph.sh in the output directory. This script reads RRD files produced and updated by Calibre at every time interval and writes out PNG files. ");
MGCAddSnippet(244, "In this procedure, you use a web server to view the PNG files produced by the CalibreRRDGraph.sh script.");
MGCAddSnippet(245, "In this procedure, you view the PNG files produced by the CalibreRRDGraph.sh script without using a web server.");
MGCAddSnippet(246, "IBM Spectrum LSF is software for managing workload processing for compute and data-intensive applications. With IBM Spectrum LSF, you can schedule and track the completion of batch workloads across a distributed environment. ");
MGCAddSnippet(247, "This procedure illustrates how to execute Calibre through IBM Spectrum LSF in Multithreaded (MT) mode using Shared Memory Multi-Processors (SMP) on the same host. In this situation, you instruct IBM Spectrum LSF to execute Calibre nmDRC-H on eight CPUs on the same host.");
MGCAddSnippet(248, "In Calibre MTflex mode, Calibre runs in a  primary‑remote  mode, where the primary host manages input data and distributes data to each host and each remote host gets data from the primary host, runs a specific SVRF operation, and returns the results back to the primary host.");
MGCAddSnippet(249, "In this procedure, you execute Calibre through IBM Spectrum LSF for a single CPU run. ");
MGCAddSnippet(250, "In this procedure, you use bsub commands in IBM Spectrum LSF to execute Calibre xRC, PDB, and FMT.");
MGCAddSnippet(251, "You can invoke the xCalibrate tool and use the REMOTE COMMAND statement to start a Calibre MTflex server on a remote host. This example shows how to use the LAUNCH CLUSTER statement to connect a primary host to one or more remote hosts and how to run xCalibrate using the -remotefile argument.");
MGCAddSnippet(252, "You will likely notice differences in the reporting of progress and performance when comparing Calibre transcripts from the same run performed twice, once using Calibre MTflex and once using Calibre MTflex with hyperscaling. These differences result from the hyperscaling optimizations, and do not indicate a variation in the expected outcome of the operations. ");
MGCAddSnippet(253, "When you run a Calibre job in Calibre MTflex mode, your transcript contains additional information regarding the Calibre MTflex operations. ");
MGCAddSnippet(254, "The following is another example of the transcript results generated as a result of running a Calibre job in Calibre MTflex mode with hyperscaling.");
MGCAddSnippet(255, "The Calibre log file includes a considerable amount of information that can be helpful in debugging performance issues encountered during a Calibre run. The following procedure identifies specific items to look for in the log file that may help improve performance for a subsequent run. ");
