MGCAddSnippet(270, "The Calibre transcript contains useful information about the local and remote hosts when Calibre is run in a distributed mode.");
MGCAddSnippet(271, "The LOAD option for the MONITOR LOCAL statement enables internal task monitoring of Calibre MTflex operations on the primary host. This reference page describes the parameters that can be found in the transcript output when you use the MONITOR LOCAL LOAD statement.");
MGCAddSnippet(272, "This reference page describes the remote host parameters that can be found in the transcript output from a running a Calibre job in Calibre MTflex mode.");
