MGCAddSnippet(309, "Calibre MTflex is designed to recover from failures on remote hosts, whether they be problems with the remote host itself or communications with the remote host. When a problem is detected on a remote host, the operation in progress is restarted and executed on the primary host, and the remote host is no longer used. A warning message is issued on the primary host to indicate the remote failure. A failure on the primary host results in failure of the run. ");
MGCAddSnippet(310, "Environment variables allow you to define some aspect of the Calibre environment that can vary.");
MGCAddSnippet(311, "Some environment variables are available for use by all Calibre tools.");
MGCAddSnippet(312, "There are some environment variables you can use to control MT (multithreaded), Calibre MTflex, hyperscaling, and simultaneous multithreaded (SMT) operations.");
MGCAddSnippet(313, "Some environment variables control operations related to licensing.");
MGCAddSnippet(314, "Some environment variables control operations related to viewing documentation.");
MGCAddSnippet(315, "Some environment variables control Calibre DESIGNrev operations.");
MGCAddSnippet(316, "Some environment variables control Calibre nmDRC operations.");
MGCAddSnippet(317, "Some environment variables control Calibre nmLVS operations.");
MGCAddSnippet(318, "Some environment variables control Calibre OPCpro operations.");
MGCAddSnippet(319, "Some environment variables control Calibre PERC operations.");
MGCAddSnippet(320, "Some environment variables configure third-party database tools and options. ");
MGCAddSnippet(321, "If you run Calibre on a 32-bit platform, you should be aware of potential 32-bit addressing limitations. There are also best practices you may want to follow to conserve memory when running Calibre, in addition to information for handling virtual memory allocation failures.");
MGCAddSnippet(322, "There are some best practices you can follow in order to conserve memory with Calibre tools on Linux platforms.");
MGCAddSnippet(323, "The most common memory allocation error you might encounter when using Calibre tools is LVHEAP MEMORY ALLOCATION FAILURE. In most cases, the Calibre tool issues this error because the platform s swap is insufficient. Generally, you should set the platform s stacksize no less than 8192 kilobytes. ");
MGCAddSnippet(324, "");
MGCAddSnippet(325, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

